description:
Starring: Tommy Gunn, Manuel Ferrara, Jynx Maze, Riley Steele, Kayden Kross, Marco Rivera, Selena Rose

Delicious Kayden Kross, lets her twisted suspicions run wild when she thinks her white husband, Tommy Gunn, is having an affair. After partying at a sexy event, she meets up with the gorgeous and sexy Selena Rose, a high priced call girl who services one of the husband's best friends. She hires her to toy with and possibly trap Tommy into having a lusty affair to prove Kayden's growing distrust. Naughty Selena has a dirty plan of her own, and turns the seductive tables on Kayden, after Kayden spreads her hungry legs for thick membered Manuel. Beautiful Riley Steele gives in to her tawdry desires, too, engaging in horny sex with handsome, hung studs.


